広告文責/販売会社:株式会社Hanbit TEL:050-1040-7307<br><br><br><br><font color="#BF0000"><b>■サイズ・色違い・関連商品</b></font><hr color="#BF0000"><br><b>袋タイプ 40枚 </b><br><b>袋タイプ 40枚 </b><br><b>袋タイプ 10枚 </b><br><b>袋タイプ 15枚 </b><br><b>袋タイプ 15枚 </b><br><b>袋タイプ 20枚 </b><br><b>コンテナ 4P </b><br><b>コンテナタイプ 3個 </b><br><b>コンテナタイプ 3個 </b><br><b>コンテナタイプ 2個 </b><br><br><br><font color="#BF0000"><b>■商品内容</b></font><hr color="#BF0000"><br>今となっては定番となりましたジッパー付きの袋。<br>丈夫なフリーザータイプなので冷凍にも対応できます。<br>スライド式のジッパータイプ。<br><br>野菜やお肉、汁物の保存にも最適です。<br>※汁物の保存には“使用上の注意”を事前に読みください。<br><br>袋のサイズは、クウォート。<br>20×14.9×4.7cm<br><br>ガロンより小さいサイズ。<br><br><br><br><br><br><font color="#BF0000"><b>■商品スペック</b></font><hr color="#BF0000"><br>【商品名】<br>　ziploc イージージッパー フリーザーバック 15P 【3個セット】<br><br>【パッケージサイズ】<br>　233×60×75mm (1個あたり)<br><br>【内容量】<br>　10枚入り<br>　20×14.9×4.7cm (1枚あたり)<br><br>【材質】<br>　パッケージ：紙<br>　<br>【生産国】<br>　アメリカ　<br><br>【特記事項】<br>原料樹脂：ポリエチレン<br>耐熱温度：100℃<br>耐冷温度：-70℃<br><br>≪使用上の注意≫<br>・乳幼児の手の届くところに置かないでください。<br>・オーブン、トースター、直火、鍋等での沸騰や湯せんに使用できません。<br>・火のそばやガス台等の熱源の近くに置かないでください。<br>・電子レンジでの解凍の際は、ジッパーの一部を開けて使用し、液状商品の解凍には受け皿をご使用ください。<br>・カレー等の油分の多い食品は電子レンジを使用すると部分的に耐熱温度を超えるため自然解凍等をおススメします。<br>・液状商品を保存する際には8分目以下にしてください。<br>また、横置きにする場合、液漏れの恐れがありますので受け皿等を使用してください。<br>・液体を入れて持ち運ばないでください。<br><br><br><br>　<br><br><br><br><br><font color="#BF0000"><b>■送料・配送についての注意事項</b></font><hr color="#BF0000"><br>●本商品の出荷目安は<b>【3 - 8営業日　※土日・祝除く】</b>となります。<br><br>●お取り寄せ商品のため、稀にご注文入れ違い等により欠品・遅延となる場合がございます。<br><br>●本商品は同梱区分<b>【TS1】</b>です。同梱区分が<b>【TS1】</b>と記載されていない他商品と同時に購入された場合、梱包や配送が分かれます。<br><br>●沖縄、離島および一部地域への配送時に追加送料がかかる場合がございます。<style type="text/css">
